        return new Source("{% extends 'base.html.twig' %}

{% block title %}Ticket index{% endblock %}

{% block body %}
    <h1>Ticket index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Title</th>
                <th>Content</th>
                <th>Status</th>
                <th>CreatedDate</th>
                <th>UpdatedDate</th>
                <th>IsEscalated</th>
                <th>CloseReason</th>
                <th>Priority</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for ticket in tickets %}
            <tr>
                <td>{{ ticket.id }}</td>
                <td>{{ ticket.title }}</td>
                <td>{{ ticket.content }}</td>
                <td>{{ ticket.status }}</td>
                <td>{{ ticket.createdDate ? ticket.createdDate|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ ticket.updatedDate ? ticket.updatedDate|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ ticket.isEscalated ? 'Yes' : 'No' }}</td>
                <td>{{ ticket.closeReason }}</td>
                <td>{{ ticket.priority }}</td>
                <td>
                    <a href=\"{{ path('ticket_show', {'id': ticket.id}) }}\">show</a>
                    <a href=\"{{ path('ticket_edit', {'id': ticket.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"10\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('ticket_new') }}\">Create new</a>
{% endblock %}
", "ticket/index.html.twig", "C:\\composer\\symfony-flow\\templates\\ticket\\index.html.twig");
